    false,nt"url": null,nt"notes": "Synoptic sampling including water column
    profiles and collected surface water samples was conducted on a bi-monthly basis
    throughout the rainy season(October-May) and on a monthly basis in the dry season
    (June-September) at nine locations in southern Kaneohe Bay in support of the Coral
    Reef Instrumented Monitoring Platform (CRIMP) program. Another dozen or so ancillary
    stations were also monitored selectively. Storm events were defined as greater than
    5.1 cm of rain at the Luluku rain gain in less than 24 hours. The nine southern
    bay stations were sampled daily for one week after or until no obvious visual evidence
    of the storm runoff remained. This is the second set of data provided to NODC. The
    first set encompasses 2005 - October 2007 and is stored in NODC Accession 0060061.",nt"license_title":
